import "./App.css";
import { BrowserRouter, Route, Routes } from "react-router-dom";

import Registration from "./components/Registration";
import Login from "./components/Login";
import ExpensePage from "./components/ExpenseForm"; // Component for ExpenseList and ExpenseForm
import ExpenseForm from "./components/ExpenseForm";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <h1>Expense Tracker</h1>
        //Routes
        <Routes>
          <Route path="/" element={<Registration />} /> // Default route to
          Registration
          <Route path="/login" element={<Login />} />
          <Route path="/expenses" element={<ExpenseForm />} />
          <Route path="*" element={<Navigate to="/" replace />} /> // Redirect
          to / for any other path
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
